FeedPackage.ReleaseNotes:
Support using string index to access member like:
dynamic json = new JDynamic("{a:{a:1}}");
Assert.AreEqual(1, json["a"]["a"]);

1. ChakraCore was updated to version 1.3;
2. Added the ability to change configuration settings of the ChakraCore JS engine: `DisableBackgroundWork` (default `false`), `DisableNativeCodeGeneration` (default `false`), `DisableEval` (default `false`) and `EnableExperimentalFeatures` (default `false`);
3. Added support of .NET Core 1.0.1.

1. Added support of .NET Core 1.0.1 and .NET Framework 4.5.1;
2. ChakraCore was updated to version 1.3;
3. Added the ability to change configuration settings of the ChakraCore JS engine: `DisableBackgroundWork` (default `false`), `DisableNativeCodeGeneration` (default `false`), `DisableEval` (default `false`) and `EnableExperimentalFeatures` (default `false`).

1. Fixed a errors, that occurred during marshaling of Unicode strings in Unix-based operating systems;
2. Native assemblies have been moved to separate packages: JavaScriptEngineSwitcher.ChakraCore.Native.win-x86 and JavaScriptEngineSwitcher.ChakraCore.Native.win-x64;
3. ChakraCore was updated to version of October 29, 2016;
4. New version of the ChakraCore for Windows requires `msvcp140.dll` assembly from the Visual C++ Redistributable for Visual Studio 2015;
5. Added the JavaScriptEngineSwitcher.ChakraCore.Native.debian-x64 and JavaScriptEngineSwitcher.ChakraCore.Native.osx-x64 packages.

